import React from "react";
import video1 from '../assets/video.mp4';
import like from '../assets/like.png';
import dislike from '../assets/dislike.png';
import share from '../assets/share.png';
import save from '../assets/save.png';
import channelAvatar from '../assets/mb.jpg';
import userAvatar from '../assets/mb.jpg';


const Videoplay = ({videoId}) => {
  const [data, setData] = useState([]);
  const fetchChannelDetails = async (channelId) => {
    const channelUrl = `https://www.googleapis.com/youtube/v3/channels?part=snippet&id=${channelId}&key=${API_KEY}`;
    try {
      const response = await fetch(channelUrl);
      const data = await response.json();
      return data.items[0].snippet.thumbnails.default.url;
    } catch (error) {
      console.error('Error fetching channel details:', error);
      return null;
    }
  };
  const fetchdata = async () => {
    let videoList_url = `https://youtube.googleapis.com/youtube/v3/videos?part=snippet%2CcontentDetails%2Cstatistics&chart=mostPopular&maxResults=50&regionCode=US&key=${API_KEY}`;
    if (Category) {
      videoList_url += `&videoCategoryId=${Category}`;
    }
    try {
      const response = await fetch(videoList_url);
      const data = await response.json();
      if (data.items) {
        const videosWithChannelImages = await Promise.all(
          data.items.map(async (item) => {
            const channelImage = await fetchChannelDetails(item.snippet.channelId);
            return { ...item, channelImage };
          })
        );
        setData(videosWithChannelImages);
      } else {
        setData([]);
      }
    } catch (error) {
      console.error('Error fetching data:', error);
      setData([]);
    }
  };
  return (
    <div className="max-w-4xl mx-auto mt-8 px-4">
      <div className="aspect-w-16 aspect-h-9 mb-4">
      <iframe className="w-full "  style={{ height: '37vw' }} src={`https://www.youtube.com/embed/${videoId}?autoplay=1`} frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>
      </div>

      <h3 className="text-xl font-bold mb-2">My youtube clone</h3>
      <div className="flex justify-between items-center mb-4">
        <p className="text-sm text-gray-500">1523 views â€¢ 2 days ago</p>
        <div className="flex space-x-4">
          <button className="flex items-center space-x-1 text-sm">
            <img src={like} alt="Like" className="w-5 h-5" />
            <span>125</span>
          </button>
          <button className="flex items-center space-x-1 text-sm">
            <img src={dislike} alt="Dislike" className="w-5 h-5" />
            <span>2</span>
          </button>
          <button className="flex items-center space-x-1 text-sm">
            <img src={share} alt="Share" className="w-5 h-5" />
            <span>Share</span>
          </button>
          <button className="flex items-center space-x-1 text-sm">
            <img src={save} alt="Save" className="w-5 h-5" />
            <span>Save</span>
          </button>
        </div>
      </div>

      {/* Channel Subscribe Section */}
      <div className="flex items-center justify-between py-4 border-t border-b border-gray-200">
        <div className="flex items-center">
          <img src={channelAvatar} alt="Channel Avatar" className="w-10 h-10 rounded-full mr-3" />
          <div>
            <h4 className="font-bold">Channel Name</h4>
            <p className="text-sm text-gray-500">1.2M subscribers</p>
          </div>
        </div>
        <button className="bg-red-600 text-white px-4 py-2 rounded-full hover:bg-red-700">
          Subscribe
        </button>
      </div>

      {/* Video Description */}
      <div className="mt-4 mb-6">
        <p className="text-sm text-gray-700">
          This is a sample video description. It can contain multiple lines of text
          and provide more information about the video content.
        </p>
      </div>

      {/* Comments Section */}
      <div className="mt-6">
        <h4 className="font-bold mb-4">123 Comments</h4>
        
        {/* Comment Input */}
        <div className="flex items-start mb-6">
          <img src={userAvatar} alt="User Avatar" className="w-8 h-8 rounded-full mr-3" />
          <div className="flex-grow">
            <input
              type="text"
              placeholder="Add a comment..."
              className="w-full p-2 border-b border-gray-300 focus:outline-none focus:border-blue-500"
            />
            <div className="flex justify-end mt-2">
              <button className="text-sm text-gray-500 mr-2">Cancel</button>
              <button className="text-sm bg-blue-500 text-white px-3 py-1 rounded">Comment</button>
            </div>
          </div>
        </div>

        {/* Individual Comments */}
        <div className="space-y-4">
          {/* Comment 1 */}
          <div className="flex">
            <img src={userAvatar} alt="User Avatar" className="w-8 h-8 rounded-full mr-3" />
            <div>
              <p className="font-semibold">User Name <span className="text-sm text-gray-500 font-normal">2 days ago</span></p>
              <p className="text-sm mt-1">This is a great video! Thanks for sharing.</p>
              <div className="flex items-center mt-2 space-x-3 text-sm text-gray-500">
                <button className="flex items-center"><img src={like} alt="Like" className="w-4 h-4 mr-1" /> 15</button>
                <button className="flex items-center"><img src={dislike} alt="Dislike" className="w-4 h-4 mr-1" /></button>
                <button>Reply</button>
              </div>
            </div>
          </div>

          {/* Comment 2 */}
          <div className="flex">
            <img src={userAvatar} alt="User Avatar" className="w-8 h-8 rounded-full mr-3" />
            <div>
              <p className="font-semibold">Another User <span className="text-sm text-gray-500 font-normal">1 day ago</span></p>
              <p className="text-sm mt-1">Interesting content, keep it up!</p>
              <div className="flex items-center mt-2 space-x-3 text-sm text-gray-500">
                <button className="flex items-center"><img src={like} alt="Like" className="w-4 h-4 mr-1" /> 7</button>
                <button className="flex items-center"><img src={dislike} alt="Dislike" className="w-4 h-4 mr-1" /></button>
                <button>Reply</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Videoplay;
